function reportdatetimepicker(control, year) {
    var today = new Date();
    var currentyear = today.getFullYear();
    var pre_year = today.setDate(0, 0, 0, 0);
    if (year != currentyear)
        var pre_year = "12/30/" + year;
    $(function () {
        $(control).daterangepicker({
            timePicker: true,
            timePickerIncrement: 30,
            locale: {
                format: 'MM/DD/YYYY h:mm A'
            },
            "minDate": "01/01/" + year + "",
            "maxDate": "12/31/" + year + "",
            "startDate": pre_year,
        });
    });
}
