//alerts-------------------------------
function ALerts(alert) {
    $('#notifydiv').removeAttr("Class");
    $('#notifydiv i').removeAttr("Class");
    var arr = [];
    arr = alert.split('-');
    Alerttexts = arr[0];
    Alerttype = arr[1];
    var time = 1000;
    var Alertclass = 'customAlert-' + Alerttype + ''

    if (Alerttype == 'success') {
        $('#notifydiv i').addClass('fa fa-check');
        time = 1000;

    }
    if (Alerttype == 'warning') {
        $('#notifydiv i').addClass('fa fa-exclamation-triangle')
        time = 1000;

    }
    if (Alerttype == 'error') {
        $('#notifydiv i').addClass('fa fa-exclamation-circle')
        time = 3000;

    }

    $('#notifydiv').addClass('' + Alertclass + ' fade in');
    $("#notifydiv span strong").html(Alerttexts)
    $("#notifydiv").show().delay(time).fadeOut('slow');

}
