function vl(element, digit) {
    console.log(element);
    var value = $(element).val();
    if (value.length == 0)
    { $(element).after("<span class='alert alert-danger alt-up'>Must be required.</span>"); }
    if (value.length > 0)
    { $(element).next("span").remove(); }
    if (value.length < digit)
    { $(element).after("<span class='alert alert-danger alt-up'>atleast " + digit + " character.</span>"); }
    if (value.length > digit)
    { $(element).next("span").remove(); }
}


//enabled button
function enabledSubmit(element, button) {
    $(element).on('keyup change', function () {
        var empty = true;
        $(element).each(function (i) {
            if ($(this).val() == '') {
                empty = true;
                $(button).prop('disabled', true);
                return false;

            }
            else {
                empty = false;
            }
        });
        if (!empty) $(button).prop('disabled', false);
    });
}


